app.controller("profileEditController",["$scope","Upload","$timeout",(o,t,l)=>{o.openUploadProfilePictureModal=(()=>{$("#uploadProfilePictureModal").modal("show")}),o.onPhotoSelect=(()=>{o.openUploadProfilePictureModal()}),o.upload=function(a,e){t.upload({url:"https://angular-file-upload-cors-srv.appspot.com/upload",data:{file:t.dataUrltoBlob(a,e)}}).then(function(t){l(function(){o.result=t.data})},function(t){t.status>0&&(o.errorMsg=t.status+": "+t.data)},function(t){o.progress=parseInt(100*t.loaded/t.total)})}}]);